import React from "react";
import './footer.css';

import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const quick__links = [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '/about',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Tours'
    },
];

const quick__links2 = [
    {
        path: '/galley',
        display: 'Galeria'
    },
    {
        path: '/login',
        display: 'Login'
    },
    {
        path: '/register',
        display: 'Register'
    },
];


const Footer = () => {

    const year = new Date().getFullYear()

    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg='3'>
                        <div className="logo">
                            <img src={logo} alt="" />
                            <p>Lorem ipsum dolor, sit amet consectetur adipisicing
                                elit. Non quod explicabo soluta, a repellat tenetur.
                            </p>

                            <div className="social__links d-flex align-items-center gap-4">
                                <span>
                                    <Link to=''><i className="ri-youtube-line"></i></Link>
                                </span>
                                <span>
                                    <Link to=''><i className="ri-facebook-circle-line"></i></Link>
                                </span>
                                <span>
                                    <Link to=''><i className="ri-instagram-line"></i></Link>
                                </span>
                            </div>
                        </div>
                    </Col>

                    <Col lg='3'>
                        <h5 className="footer__link-title">Descubrir</h5>
                        <ListGroup className="footer__quick-links">
                            {
                                quick__links.map((item, index) => (
                                    <ListGroupItem key={index} className='ps-0 border-0'>
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))}
                        </ListGroup>
                    </Col>

                    <Col lg='3'>
                        <h5 className="footer__link-title">Links Rapidos</h5>
                        <ListGroup className="footer__quick-links">
                            {
                                quick__links2.map((item, index) => (
                                    <ListGroupItem key={index} className='ps-0 border-0'>
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))}
                        </ListGroup>
                    </Col>
                    <Col lg='3'>
                        <h5 className="footer__link-title">Contacto</h5>
                        <ListGroup className="footer__quick-links">
                            <ListGroupItem className='ps-0 border-0 d-flex align-items-center gap-3'>
                                <h6 className="mb-0 d-flex align-items-center gap-2">
                                    <span><i class="ri-map-pin-line"></i></span>
                                    Direccion:
                                    <p className="mb-0">Lorem ipsum dolor.</p>
                                </h6>
                            </ListGroupItem>

                            <ListGroupItem className='ps-0 border-0 d-flex align-items-center gap-3'>
                                <h6 className="mb-0 d-flex align-items-center gap-2">
                                    <span><i className="ri-mail-line"></i></span>
                                    Email:
                                    <p className="mb-0">Lorem ipsum dolor.</p>
                                </h6>
                            </ListGroupItem>

                            <ListGroupItem className='ps-0 border-0 d-flex align-items-center gap-3'>
                                <h6 className="mb-0 d-flex align-items-center gap-2">
                                    <span><i className="ri-phone-line"></i></span>
                                    Telefono:
                                    <p className="mb-0">+51 23456789</p>
                                </h6>
                            </ListGroupItem>
                        </ListGroup>
                    </Col>

                    <Col lg='12' className="text-center pt-5">
                        <p className="copyright">
                            Copyright {year}, desing and develop by Icontinental. All rights reserved.</p>
                    </Col>

                </Row>
            </Container>
        </footer>
    );
};

export default Footer;
